					}
					c.onclick=()=>{
						let m=e[1]=="maps";
						if (e[1]=="ifl") {tbm.name="btnI";tbm.value="";}
						else {tbm.name="tbm";tbm.value=e[1];}
						switch (e[1]) {
							case "maps":bs.className="visible-app maps";break;
							case "nws":bs.className="visible-app news";break;
							default:bs.className="visible-app google";break;
						}
						target.className="token";
						c.className="token selected";
						target=c;
						if (maps!=m) {
							with (lv) while (firstChild) removeChild(firstChild);
							ap(lv,list[0].cell);
							ap(lv,list[1].cell);
							(m?mlist:slist).forEach(e=>{ap(lv,e.cell);});
							if (rnd) {if (!valid()) list[1].cell.onclick();}
							else {if (!valid()) list[0].cell.onclick();}
						}
						maps=m;
						return false;
					};
				});
				let sv=ce("scroll-view");
				let lv=ape(ape(ape(sv)),"list-view");
				let cc=(o)=>{
					let c=ce(0,"cell");
					let ch=ape(c,0,"cell-header");
					ape(ch,0,"icon "+(o.e?"letter":"image"),o.e);
					ape(ape(ch,0,"group"),0,"left",o.label);
					c.onclick=()=>{
						rnd=o.tld=="random";
						if (rnd) tld=rand();
						else tld=o;
						b.placeholder=tld.label;
						selected.id="";
						selected=c;
						c.id="focus";
						i.className="icon image"+(tld.e?" hidden":"");
						l.textContent=tld.e?tld.e:"";
						return false;
					};
					return c;
				};
				list.forEach((e,n)=>{
					switch (n) {
						case 0:e.label="Google";break;
						case 1:e.label="Google (random)";break;
						default:e.label="Google."+e.tld;break;
					}
					e.cell=cc(e);
					if (n) {
						if (e.s) {
							e.domain="www.google."+e.tld;
							slist.push(e);
						}
						if (e.m) {
							e.mapPath=(e.m-1)?`https://www.google.${e.tld}/maps`:`https://maps.google.${e.tld}/`;
							mlist.push(e);
						}
					}
					else {
						e.domain="encrypted.google.com";
						e.mapPath="https://encrypted.google.com/maps";
						e.cell.id="focus";
						selected=e.cell;
					}
				});
				ap(lv,list[0].cell);
				ap(lv,list[1].cell);
				slist.forEach(e=>{ap(lv,e.cell);});
				ap(bs,sv);
				bs.className="visible-app google";
				onload=null;
			};
		</script>
	</head>
	<body>
		<div id="base"><div id="header"><form action="https://encrypted.google.com/webhp" id="box-frame" method="get">
			<noscript><div class="icon image google"></div></noscript>
			<input type="search" id="box" name="q" placeholder="Google" role="searchbox" spellcheck="false" autocomplete="off" autofocus="autofocus" />
		</form></div></div>
		<form action="https://encrypted.google.com/search" id="form" method="get">
			<input type="hidden" name="q" id="q" />
			<input type="hidden" name="gws_rd" value="cr,ssl" />
			<input type="hidden" name="gfr_rd" value="cr" />
			<input type="hidden" name="tbm" id="tbm" value="" />
			<input type="hidden" name="ie" value="utf-8" />
			<input type="hidden" name="oe" value="utf-8" />
			<input type="hidden" name="hl" value="ja" />
			<input type="hidden" name="gl" value="ja" />
			<input type="hidden" name="num" value="100" />
			<input type="hidden" name="newwindow" value="0" />
			<input type="hidden" name="gbv" value="2" />
			<input type="hidden" name="pws" value="1" />
			<input type="hidden" name="oq" value="" />
			<input type="hidden" name="client" value="googlebot" />
		</form>
		<form action="https://encrypted.google.com/maps" id="map-form" method="get">
			<input type="hidden" name="q" id="qm" />
			<input type="hidden" name="gws_rd" value="cr,ssl" />
			<input type="hidden" name="gfr_rd" value="cr" />
			<input type="hidden" name="hl" value="ja" />
			<input type="hidden" name="client" value="googlebot" />
		</form>
	</body>
</html>
